import React, { useState } from 'react';
import { DocumentIcon } from '@heroicons/react/24/solid';
import { BrowserRouter as Router, Routes, Route, useNavigate } from 'react-router-dom';

interface TableOfContents {
  chapter: number;
  title: string;
  page: number;
}

const hardcodedTOC: TableOfContents[] = [
  { chapter: 1, title: "Relativity I", page: 1 },
  { chapter: 2, title: "Relativity II", page: 41 },
  { chapter: 3, title: "The Quantum Theory of Light", page: 65 },
  { chapter: 4, title: "The Particle Nature of Matter", page: 106 },
  { chapter: 5, title: "Matter Waves", page: 151 },
  { chapter: 6, title: "Quantum Mechanics in One Dimension", page: 191 },
  { chapter: 7, title: "Tunneling Phenomena", page: 231 },
  { chapter: 8, title: "Quantum Mechanics in Three Dimensions", page: 260 },
  { chapter: 9, title: "Atomic Structure", page: 295 },
  { chapter: 10, title: "Statistical Physics", page: 334 },
  { chapter: 11, title: "Molecular Structure", page: 372 },
  { chapter: 12, title: "The Solid State", page: 404 },
  { chapter: 13, title: "Nuclear Structure", page: 463 },
  { chapter: 14, title: "Nuclear Physics Applications", page: 503 },
  { chapter: 15, title: "Elementary Particles", page: 547 },
  { chapter: 16, title: "Cosmology (Web Only)", page: 0 },
];

const appendices = [
  "Appendix A Best Known Values for Physical Constants A.1",
  "Appendix B Table of Selected Atomic Masses A.2",
  "Appendix C Nobel Prizes A.7",
  "Answers to Odd-Numbered Problems A.12"
];

function UploadPage() {
  const navigate = useNavigate();
  const [isDragging, setIsDragging] = useState(false);

  const handleFileChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    if (event.target.files && event.target.files[0]) {
      const file = event.target.files[0];
      if (file.type === 'application/pdf') {
        navigate('/toc');
      } else {
        alert('Please upload a PDF file');
      }
    }
  };

  const handleDragOver = (e: React.DragEvent) => {
    e.preventDefault();
    setIsDragging(true);
  };

  const handleDragLeave = (e: React.DragEvent) => {
    e.preventDefault();
    setIsDragging(false);
  };

  const handleDrop = (e: React.DragEvent) => {
    e.preventDefault();
    setIsDragging(false);

    if (e.dataTransfer.files && e.dataTransfer.files[0]) {
      const file = e.dataTransfer.files[0];
      if (file.type === 'application/pdf') {
        navigate('/toc');
      } else {
        alert('Please upload a PDF file');
      }
    }
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-50 to-indigo-50 flex items-center justify-center p-4">
      <div className="max-w-2xl w-full bg-white rounded-2xl shadow-xl p-8">
        <h1 className="text-4xl font-bold text-center mb-8 text-gray-800">Physics Textbook TOC</h1>

        <div 
          className={`border-2 border-dashed rounded-xl p-12 transition-all duration-200 ${
            isDragging ? 'border-blue-500 bg-blue-50' : 'border-gray-300 hover:border-blue-400'
          }`}
          onDragOver={handleDragOver}
          onDragLeave={handleDragLeave}
          onDrop={handleDrop}
        >
          <div className="flex flex-col items-center justify-center">
            <DocumentIcon className="w-16 h-16 mb-4 text-blue-500" />
            <p className="text-xl font-medium text-gray-700 mb-2">
              Drag and drop your PDF here
            </p>
            <p className="text-gray-500 mb-6">or</p>
            <label className="px-6 py-3 bg-blue-500 text-white rounded-lg cursor-pointer hover:bg-blue-600 transition-colors duration-200">
              Browse Files
              <input
                type="file"
                className="hidden"
                accept=".pdf"
                onChange={handleFileChange}
              />
            </label>
            <p className="mt-4 text-sm text-gray-500">Only PDF files are accepted</p>
          </div>
        </div>
      </div>
    </div>
  );
}

function TOCPage() {
  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-50 to-indigo-50 p-8">
      <div className="max-w-4xl mx-auto bg-white rounded-2xl shadow-xl p-8">
        <h1 className="text-4xl font-bold text-center mb-8 text-gray-800">Table of Contents</h1>

        <div className="space-y-6">
          {hardcodedTOC.map((item) => (
            <div 
              key={item.chapter} 
              className="flex items-baseline p-4 hover:bg-gray-50 rounded-lg transition-colors duration-200"
            >
              <span className="w-16 font-bold text-blue-600">Chapter {item.chapter}</span>
              <span className="flex-grow text-lg">{item.title}</span>
              {item.page > 0 && (
                <span className="ml-4 text-gray-500 font-medium">{item.page}</span>
              )}
            </div>
          ))}
        </div>

        <div className="mt-12 pt-8 border-t border-gray-200">
          <h2 className="text-2xl font-bold mb-6 text-gray-800">Appendices</h2>
          <div className="space-y-4">
            {appendices.map((appendix, index) => (
              <div 
                key={index} 
                className="p-4 hover:bg-gray-50 rounded-lg transition-colors duration-200"
              >
                {appendix}
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<UploadPage />} />
        <Route path="/toc" element={<TOCPage />} />
      </Routes>
    </Router>
  );
}

export default App;
